import * as React from 'react';
import "../styles/style.css"

class Noticia extends React.PureComponent{

  render() {
    return(
      <div className={"news"}>
      <img className={'adImg'} src={'http://lithoralnews.com.br/images/1-janeiro18/acai-concept.png'} alt="Minha Figura"/>
          <h1>Cinco suspeitos de roubo são mortos durante tiroteio com PM em Gravatá</h1>
      </div>
    )
  }
}

export default Noticia;
